import React from "react";
import Calculator from "./Calculator";

function Projects() {
  const projects = [
    {
      name: "ToDo App",
      desc: "A simple task manager built with React",
      link: "#",
    },
    {
      name: "Weather App",
      desc: "Weather data using API and React",
      link: "#",
    },
    {
      name: "Portfolio Site",
      desc: "This portfolio built with React",
      link: "#",
    },
  ];

  return (
    <section id="projects" className="projects" data-aos="fade-up">
      <h2 className="section-title">ðŸš€ Projects</h2>
      <div className="project-list">
        {projects.map((proj) => (
          <div key={proj.name} className="project-card">
            <h4>{proj.name}</h4>
            <p>{proj.desc}</p>
            <a href={proj.link} target="_blank" rel="noreferrer">
              View Project
            </a>
          </div>
        ))}
      </div>
      <div className="project-card">
        <h3>ðŸ§® React Calculator</h3>
        <p>A responsive calculator built using React JS. Try it right here!</p>
        <Calculator />
      </div>
    </section>
  );
}

export default Projects;
